import React, {useState} from 'react'
import { BrowserRouter, Route, Link } from 'react-router-dom'
import Projects from './Projects.js'
import {FaAlignJustify, FaEyeSlash} from 'react-icons/fa';
import About from './About.js'
import Modal from 'react-modal';
import '../styles/Nav.css'

function Nav () {
    const [modalIsOpen, setModalIsOpen] = useState(false)
    const setModalIsOpenToTrue = () => {
        setModalIsOpen(true)
    }
    const setModalIsOpenToFalse =()=>{
        setModalIsOpen(false)
    }
    return (
        <BrowserRouter>
            <div className='App'>
                <div className='navigation' >
                    <div className='navigation-sub'>
                        <Link
                            to='/projects'
                            className='item'
                            activeClass="active"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                        >
                            MARIE FLORES
                        </Link>
                        <Link
                            to='/about'
                            className='item'
                            activeClass="active"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                        >
                            <FaAlignJustify classname="icon" onClick = {setModalIsOpenToTrue}/>
                            <Modal isOpen={modalIsOpen} className="modal">
                                <FaEyeSlash classname="iconCloseModal" onClick = {setModalIsOpenToFalse}/>
                                <h1>My name is Marie Flores.<br/>
                                I'm a software developer based in Paris. I'm particularly interested in javascript, Node.JS, React.<br/>
                                Find me on <a href ="https://github.com/marieflorescontact" target ="_blank" className="item">Github</a>, <a href ="https://www.linkedin.com/in/marie-flores-63110917/" target ="_blank" className="item">Linkedin</a> or <a href ="@marieflorescontact" target ="_blank" className="item">Instagram</a>. If you want to know more, don't hesitate to get in touch!
                                </h1>

                            </Modal>

                        </Link>

                    </div>
                </div>
                <Route path='/projects' component={Projects} />
                <Route path='/about' component={About} />
            </div>
        </BrowserRouter>
    )
}

export default Nav
